import React from 'react';

class Card extends React.Component{
    render(){
        return(
            <div className="card">
                 <h3>{this.state.first_name + " " + this.state.last_name}</h3>
                <p>{"Email: " + this.state.email}</p>
                <img src={this.state.avatar}/>
            </div>
        )
    }
}

export default Card;
